import { Link } from 'react-router-dom';
import './Navbar.css'; // Add styles in a separate CSS file if needed

const Navbar = () => {
    return (
        <nav style={{ padding: '10px', background: '#333', color: '#fff' ,po}}>
            <ul style={{ display: 'flex', justifyContent: 'space-around', listStyleType: 'none', margin: 0, padding: 0 }}>
                <li>
                    <Link to="/" style={{ color: '#fff', textDecoration: 'none' }}>Home</Link>
                </li>
                <li>
                    {/* <Link to="/profile/view" style={{ color: '#fff', textDecoration: 'none' }}>Profile View</Link> */}
                    <Link to="/profile" style={{ color: '#fff', textDecoration: 'none' }}>Profile View</Link>

                </li>
                <li>
                    <Link to="/profile/edit" style={{ color: '#fff', textDecoration: 'none' }}>Profile Edit</Link>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
